import React from 'react';
import logo from './logo.svg';
import './App.css';



export default class App extends React.Component {

    render () {
        return (
        <section className="todo">
            <div>
                <h2 className="section-name">ADD ITEM</h2>
                <div className="input">
                    <input type="text" className="input-task" id="addTaskInput" />
                    <button className="add-task" id="addTaskButton">Add</button>
                </div>
            </div>
            <div>
                <h2 className="section-name">TODO</h2>
                <div className="open-tasks" id="openTasks" />
            </div>
            <div>
                <h2 className="section-name">COMPLETED</h2>
                <div className="completed-tasks" id="completedTasks" />
            </div>
        </section>
        )
    }
};
